import React, { Component } from 'react';

class CollaboratorList extends Component {
  constructor(props) {
    super(props);
  
    this.state = {
      toggleEdit: []
    };
  }

  render() {

    return (
      <div style={{border: '2px solid black'}}>
        <label>No favorite</label>
      </div>
    );
  }
}

export default CollaboratorList;
